Custom IDs with PanacheMongoEntityBase does not work<p>I am trying to create a custom ID for my collection, always incrementing 1 to ID of the previous document. I am using MongoDB, Panache and Quarkus. My class looks like this:</p>
<pre><code>@MongoEntity(collection = &quot;order&quot;)
public class Order extends PanacheMongoEntityBase {


    @Id
    @BsonId
    @SequenceGenerator(
            name = &quot;referenceNumberSequence&quot;,
            sequenceName = &quot;referenceNumber_seq&quot;,
            allocationSize = 1,
            initialValue = 10000)
    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = &quot;referenceNumberSequence&quot;)
    public Integer referenceNumber;
</code></pre>
<p>I would hope that when I call persist() on an order, it would generate the referenceNumber, starting at 10000 for the first document, but no referenceNumber is generated. Instead a ObjectId _id field is generated as normal, something I do not want to happen.</p>

