Infinite document validator pattern - MongoDB<p>I am new to MongoDB and I'm trying to create a document validator for a folder tree. The goal of this document is to represent where the different folders and documents are located in a user's storage.</p>
<p>The problem I have is that I don't know how to describe the fact that each folder may have multiple folders inside them.</p>
<p>What I've came up so far with is this:</p>
<pre><code>{
  bsonType: &quot;object&quot;,
  required: [&quot;rootTree&quot;],
  properties: {
    rootTree: {
      bsonType: 'object',
      properties: {
        files: {
          bsonType: [
            'array'
          ],
          items: {
            bsonType: 'object',
            required: [
              'file_id',
              'name'
            ],
            properties: {
              file_id: {
                bsonType: 'objectId',
                description: 'the id of the file stored in the File collection'
              },
              name: {
                bsonType: 'string',
                description: 'the name of the file'
              }
            }
          }
        },
        folders: {
          bsonType: [
            'array'
          ]
        }
      }
    }
  }
}
</code></pre>
<p>So in this document validator I say that at the root of the storage I can store different files, and folders. And I'd to say that in each folder I can store many files and folders as well, but if I continue to define what is inside a folder, it will continue forever.</p>
<p>Do you have any idea on how I could proceed to define this behavior? (without creating a collection for the folders preferably)</p>
<p>For instance, can I create something like a folder type in this case?</p>

