Multikey indexing, performance drawbacks<p>Consider a collection of approximately 1 mln. documents having the following schema:</p>
<pre><code>{
    _id: ObjectId(),
    Title: &quot;&quot;,
    Description: &quot;&quot;,
    Scheduling: {
        From: 20230202,
        To: 20230201,
        MagicValue: 12
    },
    Mandatory: true,
    Type: &quot;None&quot;
}
</code></pre>
<p>Could there be any possible drawback in creating a compound index which contains a  multikey index value like so?</p>
<pre><code>{ _id: 1, Title: 1, Scheduling.From: 1 }
</code></pre>
<p>The documentation cites limitations only when dealing with nested array documents and goes on explaining index bounds creation rules and so on... If you really think about it the dummy document above could really be expressed as:</p>
